# Create PauliString objects
pauli_strings = [stim.PauliString(s) for s in stabilizers]

# Create Tableau from stabilizers
# Use allow_underconstrained=True because we might have fewer stabilizers than qubits (or redundancy)
try:
    tableau = stim.Tableau.from_stabilizers(pauli_strings, allow_underconstrained=True, allow_redundant=True)
    circuit = tableau.to_circuit("elimination")
    print(circuit)
except Exception as e:
    print(f"Error: {e}")
